function Stadium(props) {
    const {id, name, city, capacity, image} = props;

    return (
        <div className="Stadium">
            <h3>{name}</h3>
            <img src={image} width="200px"/>
            <p>Город: {city}</p>
            <p>Вместимость: {capacity}</p>
        </div>
    );
}

export default Stadium;
